import { Layout, Menu } from "antd";
import "antd/dist/antd.css";
import { useState } from "react";

const Navbar = () => {
  const [state, setstate] = useState({ keys: "" });

  const handleClick = (event) => {
      setstate({...state, key: event.key});
    console.log(event.key);
  };
  return (
    <Layout.Header>
      <Menu mode="horizontal" defaultSelectedKeys={["I1"]}>
        <Menu.Item
          key="I1"
          onClick={(event) => console.handleClick(event.log)}
        >
          Item 1
        </Menu.Item>
        <Menu.Item
          key="I2"

          onClick={(event) => console.log(event.key)}
        >
          Item 2
        </Menu.Item>
      </Menu>
    </Layout.Header>
  );
}
export default Navbar;
